@pon_gudetama 私も5年前の北海道地震でブラックアウトを経験してから、部屋を真っ暗にするのが今でも怖いです💦
地震から1年ほどは常夜灯でも暗く感じてしまい、部屋の電気を少し暗くして点灯したまま寝てました😓
一度トラウマになるとなかなか抜け出せないよね😔

text_en:
@pon_gudetama I also experienced a blackout due to the Hokkaido earthquake 5 years ago, and I'm still scared of making my room pitch black💦💦
About a year after the earthquake, I felt dark even with the night lights, so I slept with the light in the room slightly dimmed😓
Once you get traumatized, it's hard to get out of it😔

