@hakuchoco_okan @yuzutogari SNSの情報は、まず「誰が言っているか」。自治体や報道機関の公式アカウントか、大学の研究者や個人のアカウントなのか、アカウントの過去の投稿を見て不審な点がないかチェックしましょう。

普段からの備えや
正しい情報の入手が重要です🥫

text_en:
@hakuchoco_okan @yuzutogari Information on SNS is, first of all, "Who said it?" Whether it's an official account of a local government or a news organization, or an account of a university researcher or an individual, look at the past posts of the account and check if there are any suspicious points.

usual preparations
Getting the right information is important 🥫

