text:
@algonz36 Post terremoto cayeron algunas cárceles y las restantes estabas abarrotadas (más de lo normal).
Se hizo una ley general (por congreso) y quienes estaban en ciertas condiciones se liberaron.
El congreso aprobó. Fue una medida general por ley y no indulto individual del presidente

text_en:
@algonz36 Post-earthquake, some prisons fell and the rest were overcrowded (more than normal).
A general law was made (by congress) and those who were in certain conditions were released.
Congress approved. It was a general measure by law and not an individual pardon from the president

